import IUnverifiedAccount from "../../../models/IUnverifiedAccount";

const UnverifiedAccountESAR: IUnverifiedAccount = {
    title: "Tu cuenta no esta verificada",
    subTitle:
        "Identificamos que {email} ya tiene una cuenta creada pero aun falta verificar el email.",
    verifyNow: "Verifícalo ahora, es rápido!",
    textBtn: " Verificar email",
};

export default UnverifiedAccountESAR;
